    "aboutTitle": "關於Rhythm Nexus",
    "aboutP1": "我們於2022年開設商店，並在Etsy、eBay和Shopee上銷售。",
    "aboutP2": "我們專注於可靠的履行和準確的追蹤，建立了良好的聲譽。",
    "aboutP3": "我們的目標是提供流暢可信的購物體驗。",
