    "countryMsgID": "Me utu e koe nga taake me nga taake e tika ana i te taenga mai ki Iniaone. Tena koa tirohia to peera me te utu i nga moni kua tohua ki nga tikanga Iniarangi.\nKa tonohia ano koe ki te tuku i etahi atu pepa whakamana. Ki te kore e pera, ka aukatihia te urunga, te kapohia ranei o te kete e nga tikanga whenua. Tena koa tirohia etahi atu korero i konei:\nhttps://www.beacukai.go.id/barangkiriman",
